measurements.description:
Fourteen flowers on one 71-cm staked arching inflorescence;
	sepals and petals medium green, faint pink blush centrally, burgundy basally; 
	lip cream, heavily spotted maroon, coalescing near margin, keel pale yellow spotted burgundy distally;
	column cream, finely stippled burgundy, anther cap cream;	


    substance firm; texture matte.
